		--fill: linear-gradient(90deg, rgb(255, 107, 0) 0%, rgb(255, 214, 0) 100%);
	}

	.loader_c {
		position: absolute;
		width: 100%;
		height: 100%;
		background-color: #000000;
	}

	.container {
		position: absolute;
		left: 50%;
		width: 50%;
		top: 45%;
		height: 40%;
		max-height: 80vh;
		transform: translate(-50%, -50%);
		background: var(--logo-image) top center/auto 50% no-repeat;
		background-size: contain;
	}

	.progress-bar {
		position: absolute;
		bottom: -7%;
		width: 150%;
		height: clamp(0.285em, 2.5vw, 0.35em);
		left: 50%;
		transform: translate(-50%, -50%);
		border-radius: 0.4em;
		background: linear-gradient(180deg, #404040, #303030);
		font: clamp(0.625em, 10vw, 8em) monospace;
		border: solid 0.09em #4d4d4d;
		box-shadow: 0px 0px 0.3em rgba(124, 124, 124, 0.8);
		box-sizing: border-box;
	}

	.progress-bar::before {
		content: '';
		display: block;
		width: 105%;
		height: 533%;
		position: absolute;
		top: 50%;
		left: 50%;
		transform: translate(-50%, -50%);
		background: var(--frame) center/cover no-repeat;
		/* background-size: 100% 100%; */
		/* background:rgb(172, 146, 128) */
	}

	.progress-fill {
		height: 100%;
		border-radius: 0.4em;
		background: var(--fill);
		width: 10%;
		/* Adjust this to represent the progress value */
		position: relative;
		z-index: 1;
		/* Ensure the fill is above the before element */
	}

	@media (orientation: landscape) {
		.container {
			top: 40%;
			height: 50%;
		}

		.progress-bar {
			bottom: -15%;
			width: 85%;
			/* font: clamp(0.625em, 6.5vw, 3em) monospace; */
		}

		.progress-bar::before {
			width: 135%;
			height: 470%;
			transform: translate(-50%, -51%) scale(78%, 105%);

		}

		@keyframes blink {
			0% {
				opacity: 1
			}

			99% {
				opacity: 0
			}

			100% {
				opacity: 0
			}
		}
</style>
<div class="loader_c">
	<div class="container">
		<div class="progress-bar">
			<div class="progress-fill"></div>
		</div>

	</div>
</div>
<script>
	const onDOMReady = () => {
		const progress = document.querySelector('.progress-bar');
		const progressFill = document.querySelector('.progress-fill');
		const timeStamp = Date.now();
		const dProgress = 0.06;

		const increaseProgress = () => {
			const dt = Date.now() - timeStamp;

			if (+progressFill.style.width.replace('%', '') < 100) {
				let dx = dt * dProgress + 10;
				progressFill.style.width = `${Math.min(100, dx)}%`;
				requestAnimationFrame(increaseProgress);
			}
		};

		requestAnimationFrame(increaseProgress);
	};
